import React from 'react'
import { Link, useParams } from 'react-router-dom'
export default function EventDetail() {
  const params=useParams();
  return (
    <>
    <h1>Events Detail Page</h1>
    <p>Event Id:{params.eventId}</p>
    <Link to='..'>Back</Link>
    </>
  )
}
